Heres a focused review at 325px width. Overall it fits the viewport (no horizontal overflow visible), but there are a few usability and readability issues on small phones.

---

## 1) Layout overflow
 No obvious horizontal overflow.  
 The chat card and inner panels feel tight: left/right padding is minimal, which makes borders feel cramped.

**Fix (add horizontal breathing room in the card):**
```css
.horses-hub .content-card {
  padding: 16px 14px; /* if currently tighter */
}
```

---

## 2) Touch targets (44px minimum)
### Section nav buttons (Horse Chooser / All Horses / Horse Gear)
These look short and compressed. Likely <44px height.

**Fix:**
```css
.section-nav button {
  min-height: 44px;
  padding: 12px 16px;
  font-size: 16px; /* if currently smaller */
}
```

### Quick prompt buttons
The prompt quote buttons are tall enough but have small vertical text padding. Ensure min height.

```css
.quick-prompts button {
  min-height: 44px;
  padding: 12px 14px;
}
```

### Back link
Text-only Back to RDR2 Companion is not a 44px touch target.

```css
.back-link {
  display: inline-flex;
  align-items: center;
  min-height: 44px;
  padding: 6px 10px;
}
```

---

## 3) Text readability
- The serif italic body text (Find the perfect mount) looks small and low-contrast on mobile.
- Footer disclaimer is too small.

**Fix:**
```css
.horses-hub .subtitle,
.horses-hub .body-text {
  font-size: 15px; /* bump from 1314 */
  line-height: 1.5;
  color: #d2c7b8; /* slightly brighter */
}

.footer-disclaimer {
  font-size: 13px;
  line-height: 1.4;
  color: #b9b1a6;
}
```

---

## 4) Navigation usability (section nav buttons)
The three stacked nav buttons feel visually identical and static. Theres no hover/active state in the screenshot. Also the spacing is very tight in mobile.

**Fix:**
```css
.section-nav button {
  margin-bottom: 10px;
  border-color: rgba(255,255,255,0.15);
}

.section-nav button:active,
.section-nav button:focus-visible {
  background: rgba(255,255,255,0.06);
  outline: 2px solid #b88b5a;
  outline-offset: 2px;
}
```

---

## 5) Input area usability
- Input placeholder (Ask about RDR2...) is low contrast.
- The send button is okay, but the refresh/back icon on the right is small and low contrast.

**Fix:**
```css
.chat-input input::placeholder {
  color: #a99f92;
}

.chat-input button {
  min-width: 44px;
  min-height: 44px;
}

.chat-input .icon-button {
  background: rgba(255,255,255,0.06);
  border-color: rgba(255,255,255,0.2);
}
```

---

## 6) Visual bugs / inconsistencies
- There is visible duplication in your screenshots (same section appears twice). If thats real (not screenshot artifact), check for repeated component rendering.
- The inner card border shadow feels too heavy for mobile and reduces usable space.

**Lighten the inner frame:**
```css
.content-card {
  box-shadow: 0 0 0 1px rgba(255,255,255,0.08);
}
```

---

### Summary of key issues
- **Touch targets:** Section nav + back link need 44px height.
- **Text:** Body and disclaimer are too small/light.
- **Input:** Placeholder + icon buttons low contrast.
- **Spacing:** Card padding too tight for 325px.

If you can share actual class names I can give exact selectors.
